import styled from 'styled-components';

export const FormContainer = styled.div`
    color: #fff;
    padding: 48px 24px;
    margin: 0;
    padding: 0;
    background: #000;
    margin-top: 80px;

    @media screen and (max-width: 768px) {
        padding: 0 24px 48px 24px;
    }
`

export const FormWrapper = styled.iframe`
    width: 100%;
    height: 100%;
    border-radius: 0 !important;
`
